@SottoPaulo Hello Paulo, thank you for your comment. It takes a total of 1 million signatures in the entire EU, involving at least 7 EU countries for an initiative to be successful.
Check out the lifecycle here: https://t.co/MBNmRxQ4vm
All the best, the Social Media Team #EUTakeTheInitiative

@BlueNicht Hallo, danke, dass ihr eure Gedanken teilt. Wir freuen uns über eure Beiträge und möchten euch ermutigen, selbst eine Europäische Bürgerinitiative zu starten → https://t.co/6Fab4Es0mG
